(171, '6.2', 'Con el contrapeso sobre sus topes, no hay espacio para contener un paralelepípedo rectangular no menor a 0.5 m x 0.6 m x 0.8 m apoyado sobre una de sus caras encima de cabina. (Para los ascensores con suspensión directa, se incluyen los cables de suspensión y sus amarres en dicho volumen, siempre que ningún cable tenga su eje a una distancia superior a 0.15 m de, al menos una cara vertical del paralelepípedo).\n', 'Leve'),
