(103, '6.9', 'Instalaciones o elementos en pozo o sala de máquinas ajenas a las propias del ascensor (Gas, aire acondicionado, acueducto, telecomunicaciones, acometidas eléctricas o hidráulicas, etc.)', 'Muy Grave'),
