(38, 'Falta o falla el interruptor de alimentación.', 'Grave'),
(39, 'No hay coherencia de los mandos.', 'Grave'),
(40, 'Se presenta visualización o falla cuando algún equipo electrónico de la puerta tiene pantalla o display.', 'Leve'),
(41, 'Se evidencia falla en la electro cerradura.', 'Grave'),
(42, 'Las baterías están descargadas (en caso de funcionar con baterías).', 'Grave');
